                $slide = $main.find('.swiper-wrapper').children("div,li").addClass("swiper-slide"),
                slide = $main.find('.swiper-slide').length,
                thumbsOptions = $thumbs.data('swiper-options'),
                mainOptions = $main.data('swiper-options'),
                galleryThumbs = [],
